import numpy as npif __name__ == "__main__":    n = int(input('n:\t'))    if n > 100:        n = 100    if n < 1:        n = 1    matrix = np.zeros((n, 2))    oriented = False    counter = 0    while counter < n:        input_vector = np.array(list(map(int, input(f"{counter+1}-я строка:\t").split())))        if (len(input_vector) != 2):            print('Не верный ввод строки!')            continue        matrix[counter] = input_vector        counter += 1    for i in range(n):        for j in range(n):            if matrix[i][0] == matrix[j][1] and(               matrix[i][1] == matrix[j][0]):               oriented = True    print(matrix)    print("YES" if oriented else "NO")